import React from "react";

class Pro extends React.Component{
    constructor(){
        super()

        this.state = {
            age: "90",
            cost: "99999"
        }

    } 
    render(){
        return (
            <div>
                <h1>First Class Name {this.state.age}</h1>
            </div>
        )
    }
}

export default Pro;
